  \"2016-08-17T10:44:03.212460\",\n\t\"name\": \"outer-continental-shelf-official-protraction-diagrams-and-lease-maps-gulf-of-mexico-region-nad\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This file is based on the Mapping and Boundary
  Branch's Official Protraction Diagram (OPD)and Leasing Maps (LM). Each offshore
  area is defined by an API Number corresponding to those in the API Bulletin Number
  D12A. OPDs are numbered using the United Nations International Map of the World
  Numbering System, and are generally named for land or hydrographic features contained
  within the limits of the diagram. This data set contains Official Protraction Diagram
  (OPD) and Leasing Map (LM) outlines in ESRI shape file formats for the BOEM Gulf
  of Mexico Region. The use of OPDs and LMs makes it easier to refer to individual
  blocks within a region or planning area. These diagrams were clipped along the Submerged
  Lands Act (SLA) boundary and along lines contained in the Continental Shelf Boundaries
  (CSB) GIS data files to show only those blocks or portions thereof within federal
  jurisdiction. Because GIS projection and topology functions can change or generalize
  coordinates, these GIS files are NOT an OFFICIAL record for the exact OPD boundaries.
  Only the paper OPD or a digital image of them serves as OFFICIAL records.Official
  Protraction Diagrams and other cadastre information the BOEM produces are generated
  in accordance with 30 Code of Federal Regulations (CFR) Part 556.8 Subpart A, (formerly
  Part 256.8 Subpart A (2010)) to support Federal land ownership and mineral resource
  management. Additional details are available from: http://www.boem.gov/uploadedFiles/BOEM/Oil_and_Gas_Energy_Program/Mapping_and_Data/99-0006.pdf
  Because GIS projection and topology functions can change or generalize coordinates,
  and because shapefiles cannot represent true arcs, these GIS files are considered
  to be approximate and are NOT an OFFICIAL record for the exact block coordinates
  or areas. The Official Protraction Diagrams (OPDs)and Leasing Maps (LMs) and Supplemental
  Official Block Diagrams (SOBDs) serve as the legal definition for BOEM offshore
  boundary coordinates and area descriptions and can be found at the following location:
  http://www.boem.gov/Official-Protraction-Diagrams/. Contains the protraction polygons
  clipped on the fedstate (SLA-Boundary) as of March 15, 2013. Used ArcCatalog to
  create shape files.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
